import React,{Component} from "react";
import variables from './../variables';
import { Button, Table,Alert, Modal, ModalHeader, ModalBody, FormGroup, Label, Input, ModalFooter, Dropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';


/* function getMonthName(monthNumber) {
  const months = [
    "January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"
  ];
  return months[monthNumber - 1];
} */

function getMonthName() {
  const months = [
    "January", "February", "March", "April", "May", "June",
    "July", "August", "September", "October", "November", "December"
  ];
  const d = new Date();
  return months[d.getMonth()];
}

export class StudentRoster extends Component {
    constructor(props) {
        super(props);
        this.state = {
            roster_id: 0,
            month: "",
            year:"",
            doctor: {
                doctor_id:"",
                doctor_name:"",
            },
            rosters:[],
            groupedByDay: {},
            dayslot:{
                day:"",
                slot:"",
            },
            doctors:[],
            dayslots:[],
           
        }
    }
    refreshList() {
        fetch(variables.API_URL + 'roster/') 
          .then(response => response.json())
          .then(data => {
            if ('data' in data && Array.isArray(data.data)) {
              // Group the rosters by day
              const groupedByDay = data.data.reduce((acc, roster) => {
                const day = roster.dayslot.day;
                if (!acc[day]) {
                  acc[day] = [];
                }
                acc[day].push(roster);
                return acc;
              }, {});
    
              this.setState({
                rosters: data.data,
                groupedByDay: groupedByDay // Store the grouped rosters in the state
              });
            } else {
              console.error('Expected an object with a data property containing an array, but got ', data);
            }
          });


          fetch(variables.API_URL + 'dayslot/') 
            .then(response => response.json())
            .then(data => {
                if ('data' in data && Array.isArray(data.data)) {
                const dayslots = data.data.map(dayslot => {
                    return {
                    id: dayslot.id,
                    day: dayslot.day,
                    slot: dayslot.slot
                    };
                });
                console.log(dayslots); // Log the mapped dayslots array
                this.setState({
                    dayslots: dayslots
                });
                } else {
                console.error('Expected an object with a data property containing an array of dayslot objects, but got ', data);
                }
            });



            fetch(variables.API_URL + 'doctor/') 
            .then(response => response.json())
            .then(data => {
               if ('data' in data && Array.isArray(data.data)) {
                 const doctors = data.data.map(doctor => {
                   return {
                     doctor_id: doctor.doctor_id,
                     doctor_name: doctor.doctor_name,
                     specialization: doctor.specialization
                   };
                 });
                 console.log(doctors); // Log the mapped doctors array
                 this.setState({
                   doctors: doctors
                 });
               } else {
                 console.error('Expected an object with a data property containing an array of doctor objects, but got ', data);
               }
            });
    }
    
    

      componentDidMount() {
        this.refreshList();
        }
      
        groupByDay(rosters) {
            return rosters.reduce((groups, roster) => {
                const day = roster.dayslot.day;
                if (!groups[day]) {
                    groups[day] = [];
                }
                groups[day].push(roster);
                return groups;
            }, {});
        }

      
        render() {
            const {
                rosters,
               
                groupedByDay, 
                doctor: {
                    doctor_id,
                    doctor_name,
                },
                dayslot:{
                    day,
                    slot,
                },
               
            } = this.state;
            
            return (
                <div>
                    <div color="secondary" className="mt-3 mx-auto" style={{maxWidth: '90%'}}>
                <Alert color="primary">
                 {/* Doctor Roster:<h1> {getMonthName(rosters[0]?.month)} </h1> */}
                 Doctor Roster:<h1> {getMonthName()} </h1>
                    </Alert>
                    </div>
        
                   
                <Table bordered className="mt-3 mx-auto" style={{maxWidth: '90%',textAlign:'center'}}>
                    <thead>
                        <tr>
                            <th>Roster Id</th>
                            <th>Day</th>
                            <th>Slot</th>
                            <th>Doctor Name</th>
                            {/* <th>Options</th> */}
                        </tr>
                    </thead>
                    <tbody>
            {Object.keys(groupedByDay).map((day, dayIndex) => (
                <React.Fragment key={dayIndex}>
                    {groupedByDay[day].map((roster, rosterIndex) => (
                        <tr key={roster.roster_id}>
                            <td>{rosterIndex === 0 ? dayIndex + 1 : ''}</td>
                            <td>{rosterIndex === 0 ? day : ""}</td>
                            <td>{roster.dayslot.slot}</td>
                            <td>{roster.doctor.doctor_name}</td>
                            {/* <td>
                                <Button outline color="danger" onClick={() => this.deleteClick(roster.roster_id)}>
                                    Delete
                                </Button>
                            </td> */}
                        </tr>
                    ))}
                </React.Fragment>
            ))}
        </tbody>
                </Table>
                    </div>
                        )}
                       
                    }
                    export default StudentRoster;
